import React,  { useState, useEffect } from 'react';

import { Title } from '../Components';
import { getProperty } from '../DataHandler';

import './CSS/Predigtreihen.css'

export default function Predigtreihen(){
    document.title = "FBG Bremen - Predigten";

    return (
        <>
            <Title title="Predigtreihen"/>
        </>
    );
}

function Playlists(props){
    const [data, setData] = useState();

    useEffect(() => {
        getProperty("playlists").then(function(content) { setData(content); });
    }, []);

    if(data === undefined) return;


}
